import * as React from 'react';

import AppBar from '@mui/material/core/AppBar';
import Box from '@mui/material/core/Box';
import Toolbar from '@mui/material/core/Toolbar';
import Typography from '@mui/material/core/Typography';
import Button from '@mui/material/core/Button';
import IconButton from '@mui/material/core/IconButton';
import MenuIcon from '@mui/material/core/Menu';

export default function ButtonAppBar() {
    return (
        <Box sx={{ flexGrow: 1 }}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                        <MenuIcon />
                    </IconButton>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                        Stack management System
                    </Typography>
                    <Button color="inherit">Create</Button>
                    <Button color="inherit">Signin</Button>
                    <Button color="inherit">add Employee</Button>
                </Toolbar>
            </AppBar>
        </Box>
    );
}
